import CS
A = CS.read_txt('1.txt')

input = ''
#input = A[0]

def create_list(string,x,repeat):
    
    B  = []
    for i in range(x,x+repeat):
        B.append(string[i])
    return B

def has_duplicates(lst):
    return len(lst) != len(set(lst))


#print(A[0].getC))

Unique_len = 4
for j in range(len(input)-Unique_len):
    C = create_list(input, j,Unique_len)
    if has_duplicates(C) is True:
        j=j+1
    else:
        print(j+Unique_len)
        print(C)